import React, { useState, useEffect } from 'react';
import "./Navbar.scss";
import { useNavigate } from "react-router-dom";
import product from "../../asset/datapizza";

const Navbar = (props) => {

    const [search, setSearch] = useState("");
    const [data, setData] = useState([]);

    const navigation = useNavigate();

    const moveHome = () => {
        navigation("/home");
    };

    useEffect(() => {
        setData(product);
    }, []);

    const onChangeSearch = (e) => {
        setSearch(e.target.value)
    }

    const onSnbmitSearch = () => {
        props.searchProduct(search)

    };
    return (
        <div className="Navbar-container">
            <div className="Navbar-logo">
                <img src="data:image/png;base64," alt="" />
            </div>
            <div className="Navbar-menu">
                <ul>
                    <li onClick={moveHome}>HOME</li>
                </ul>
                <ul>
                    <li>MENU </li>
                </ul>
                <ul>
                    <li>SHALE </li>
                </ul>
                <ul>
                    <li>POLICY </li>
                </ul>
                <ul>
                    <li>BLOG </li>
                </ul>
                <ul>
                    <li>CONTACT</li>
                </ul>
            </div>
            <div className="searchItem">

                <input className='search' type="text" placeholder='Search' 
                value={search}
                onChange={onChangeSearch}
                />
                <span class="icon"><i class="fa fa-search" 
                inverted
                circular
                link
                onClick={onSnbmitSearch}
                ></i></span>
            </div>
            <div className="acount">
            <span className='iconacount'> <i class="fa fa-user" /></span>
            </div>
        </div>
    );
};

export default Navbar;
